import React, { useState } from 'react';
import './App.css';
import TabNavigation from './components/layout/TabNavigation';
import HomePage from './pages/HomePage';
import ProjectDetail from './components/projects/ProjectDetail';

function App() {
  const [activeTab, setActiveTab] = useState('home');

  const renderContent = () => {
    switch (activeTab) {
      case 'bayt-elite':
        return <ProjectDetail projectId="bayt-elite" />;
      case 'tawasul-ai':
        return <ProjectDetail projectId="tawasul-ai" />;
      case 'zimam-delivery':
        return <ProjectDetail projectId="zimam-delivery" />;
      case 'almultaqia':
        return <ProjectDetail projectId="almultaqia" />;
      case 'home':
      default:
        return <HomePage onProjectSelect={setActiveTab} />;
    }
  };

  return (
    <div className="App">
      <TabNavigation activeTab={activeTab} onTabChange={setActiveTab} />
      <main>
        {renderContent()}
      </main>
    </div>
  );
}

export default App;
